(1, 1, '2020-10-14 04:11:57', '2020-10-14 04:11:57', '<!-- wp:paragraph -->\n<p>Selamt datang di WordPress. Ini adalah pos pertama Anda. Sunting atau hapus, kemudian mulai menulis!</p>\n<!-- /wp:paragraph -->', 'Halo dunia!', '', 'publish', 'open', 'open', '', 'halo-dunia', '', '', '2020-10-16 07:58:22', '2020-10-16 07:58:22', '', 0, 'http://localhost/raputrigroup/?p=1', 0, 'post', '', 1),
(2, 1, '2020-10-14 04:11:57', '2020-10-14 04:11:57', '<!-- wp:paragraph -->\n<p>Ini adalah halaman contoh. Halaman ini berbeda dari artikel blog karena akan tetap di satu tempat dan akan muncul di navigasi situs Anda (di sebagian besar tema). Kebanyakan orang memulai dengan halaman \"Tentang\" yang bertujuan untuk mengenalkan mereka kepada pengunjung potensial situs. Biasanya berisi seperti ini:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hai yang disana! Saya seorang kurir bersepeda di siang hari, di malam hari bermimpi menjadi seorang aktor, dan ini adalah situs web saya. Saya tinggal di Los Angeles, punya anjing besar bernama Jack, dan saya suka pi&#241;a minuman Colada. (Dan terjebak dalam hujan.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...atau seperti ini:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Perusahaan Doohickey XYZ didirikan pada tahun 1971, dan telah menyediakan doohickey berkualitas untuk masyarakat umum sejak saat itu. Terletak di Kota Gotham, XYZ mempekerjakan lebih dari 2.000 orang dan melakukan segala macam hal luar biasa untuk komunitas Gotham.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Sebagai pengguna baru WordPress, Anda harus membuka <a href=\"http://localhost/raputrigroup/wp-admin/\">dasbor Anda</a> untuk menghapus laman ini dan membuat laman-laman baru untuk konten Anda. Have fun!</p>\n<!-- /wp:paragraph -->', 'Laman Contoh', '', 'publish', 'closed', 'open', '', 'laman-contoh', '', '', '2020-10-14 04:11:57', '2020-10-14 04:11:57', '', 0, 'http://localhost/raputrigroup/?page_id=2', 0, 'page', '', 0),
(3, 1, '2020-10-14 04:11:57', '2020-10-14 04:11:57', '<!-- wp:heading --><h2>Siapa kami</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Alamat situs web kami adalah: http://localhost/raputrigroup.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Data pribadi apa yang kami kumpulkan dan mengapa kami mengumpulkannya</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Komentar</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Saat pengunjung meninggalkan komentar pada situs, kita mengumpulkan data yang ditampilkan pada form komentar, alamat IP pengunjung dan user agent browser untuk membantu pendeteksian spam.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>String anonim yang dibuat dari alamat email Anda (juga disebut hash) dapat diberikan ke layanan Gravatar untuk melihat apakah Anda menggunakannya. Kebijakan privasi layanan Gravatar tersedia di sini: https://automattic.com/privacy/. Setelah persetujuan atas komentar Anda, gambar profil Anda dapat dilihat oleh publik dalam konteks komentar Anda.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Media</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Jika Anda mengunggah gambar ke situs web, Anda harus menghindari mengunggah gambar dengan data lokasi tertanam (GPS EXIF) yang disertakan. Pengunjung ke situs web dapat mengunduh dan mengekstrak data lokasi apa pun dari gambar di situs web.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Formulir Kontak</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Jika Anda meninggalkan komentar di situs kami, Anda dapat memilih untuk menyimpan nama, alamat email, dan situs web Anda dalam cookie. Ini untuk kenyamanan Anda sehingga Anda tidak perlu mengisi detail Anda lagi ketika Anda meninggalkan komentar lain. Cookie ini akan bertahan selama satu tahun.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Jika Anda mengunjungi halaman login kami, kami akan memasang cookie sementara untuk memastikan apakah browser Anda menerima cookie. Cookie ini tidak mengandung data pribadi dan dibuang ketika Anda menutup browser Anda.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Saat Anda log masuk, kami akan menyiapkan beberapa cookie untuk menyimpan informasi log masuk Anda dan tampilan yang Anda pilih. Cookie log masuk berlaku selama dua hari, dan cookie pengaturan tampilan berlaku selama satu tahun. Jika Anda memilih &quot;Ingatkan Saya&quot;, log masuk anda akan bertahan selama dua minggu. Jika Anda log keluar dari akun, cookie log masuk akan dihapus.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Jika Anda menyunting atau menerbitkan artikel, cookie tambahan akan disimpan di browser Anda. Cookie ini tidak menyertakan data pribadi dan hanya menunjukkan ID posting dari artikel yang baru saja Anda sunting. Kadaluwarsa setelah 1 hari.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Konten yang disematkan dari situs web lain</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Artikel-artikel di dalam situs ini dapat menyertakan konten terembed (seperti video, gambar, artikel, dll). Konten terembed dari situs web lain akan berlaku sama dengan pengunjung yang mengunjungi situs web lain.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Situs-situs web ini dapat mengumpulkan data tentang Anda, menggunakan cookies, menanamkan pelacak dari pihak ketiga, dan memonitor interaksi Anda dengan muatan tertanam, termasuk menggunakannya untuk melacak interaksi Anda jika Anda memiliki sebuah akun dan masuk ke dalam situs web tersebut.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analitik</h3><!-- /wp:heading --><!-- wp:heading --><h2>Dengan siapa kami membagi data Anda</h2><!-- /wp:heading --><!-- wp:heading --><h2>Berapa lama kami menyimpan data Anda</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Jika Anda meninggalkan komentar, komentar dan metadatanya dipertahankan tanpa batas. Ini agar kami dapat mengenali dan menyetujui komentar tindak lanjut secara otomatis dan tidak menahannya dalam antrean moderasi.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Untuk pengguna yang mendaftar pada website kami (jika ada), kami juga menyimpan informasi pribadi yang mereka berikan dalam profil pengguna mereka. Semua pengguna dapat melihat, mengedit, atau menghapus informasi pribadi mereka kapan saja (kecuali mereka tidak dapat mengubah nama pengguna mereka). Administrator situs juga dapat melihat dan mengedit informasi tersebut.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Hak apa yang Anda miliki atas data ANda</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Jika anda mempunyai akun di situs ini, atau telah meninggalkan komentar, anda dapat meminta untuk mendapat data personal dalam file export dari kami, termasuk data yang anda berikan kepada kami. Anda juga dapat meminta kami menghapus data personal mengenai anda. Ini tidak termasuk data yang wajib kami simpan untuk keperluan administratif, hukum, atau keamanan.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Ke mana kami kirim data Anda</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Komentar pengunjung dapat diperiksa melalui layanan deteksi spam otomatis.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Informasi kontak Anda</h2><!-- /wp:heading --><!-- wp:heading --><h2>Informasi tambahan</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Bagaimana kami melindungi data Anda</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Apa prosedur kebocoran data yang kami miliki</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Pihak ketiga mana saja data yang kami terima berasal</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Apa pengambilan keputusan otomatis dan/atau profil yang kami lakukan dengan data pengguna</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Persyaratan pengungkapan regulasi industri</h3><!-- /wp:heading -->', 'Kebijakan Privasi', '', 'draft', 'closed', 'open', '', 'kebijakan-privasi', '', '', '2020-10-14 04:11:57', '2020-10-14 04:11:57', '', 0, 'http://localhost/raputrigroup/?page_id=3', 0, 'page', '', 0),
(14, 1, '2020-10-14 05:07:09', '2020-10-14 05:07:09', '<p>Bersantai dan melepas penat dengan suasana yang sejuk dan asri menghadap pantai di pagi hari sangatlah menyenangkan untuk melepas beban hidup kita.</p>		\n										<img width=\"1024\" height=\"684\" src=\"http://localhost/raputrigroup/wp-content/uploads/2020/10/245481278.jpg\" alt=\"Villa Grand\" loading=\"lazy\" srcset=\"http://localhost/raputrigroup/wp-content/uploads/2020/10/245481278.jpg 1024w, http://localhost/raputrigroup/wp-content/uploads/2020/10/245481278-300x200.jpg 300w, http://localhost/raputrigroup/wp-content/uploads/2020/10/245481278-768x513.jpg 768w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" />											\n		<p>Ini adalah tempat teromantis untuk mengikat janji dengan pasangan. Grand Villa yang memiliki pemandangan yang menakjubkan akan membuat impian pernikahan anda menjadi kenyataan.</p>		\n										<img width=\"1024\" height=\"410\" src=\"http://localhost/raputrigroup/wp-content/uploads/2020/10/Meetings04-1024x410.jpg\" alt=\"Weeding\" loading=\"lazy\" srcset=\"http://localhost/raputrigroup/wp-content/uploads/2020/10/Meetings04-1024x410.jpg 1024w, http://localhost/raputrigroup/wp-content/uploads/2020/10/Meetings04-300x120.jpg 300w, http://localhost/raputrigroup/wp-content/uploads/2020/10/Meetings04-768x307.jpg 768w, http://localhost/raputrigroup/wp-content/uploads/2020/10/Meetings04-1536x615.jpg 1536w, http://localhost/raputrigroup/wp-content/uploads/2020/10/Meetings04.jpg 1599w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" />											\n		<p>&nbsp; Langit biru dengan kolam renang yang menyegarkan semakin memberikan pengalaman menginap yang tak akan terlupakan.<br></p>		\n										<img width=\"1024\" height=\"574\" src=\"http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-pixabay-261101-1024x574.jpg\" alt=\"Kolam Renang\" loading=\"lazy\" srcset=\"http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-pixabay-261101-1024x574.jpg 1024w, http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-pixabay-261101-300x168.jpg 300w, http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-pixabay-261101-768x430.jpg 768w, http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-pixabay-261101-1536x861.jpg 1536w, http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-pixabay-261101-2048x1148.jpg 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" />											\n		<p>Makan bersama keluarga, teman, sahabat, maupun pasangan akan lebih nikmat dengan menyantap makanan di restaurant berkelas ini.</p>		\n										<img width=\"1024\" height=\"577\" src=\"http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-quark-studio-32019211-1024x577.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-quark-studio-32019211-1024x577.jpg 1024w, http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-quark-studio-32019211-300x169.jpg 300w, http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-quark-studio-32019211-768x432.jpg 768w, http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-quark-studio-32019211-1536x865.jpg 1536w, http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-quark-studio-32019211-2048x1153.jpg 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" />											\n		<p>Kamar tidur yang elegan akan memberikan rasa nyaman saat tidur.</p>		\n										<img width=\"1024\" height=\"683\" src=\"http://localhost/raputrigroup/wp-content/uploads/2020/10/244070108.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/raputrigroup/wp-content/uploads/2020/10/244070108.jpg 1024w, http://localhost/raputrigroup/wp-content/uploads/2020/10/244070108-300x200.jpg 300w, http://localhost/raputrigroup/wp-content/uploads/2020/10/244070108-768x512.jpg 768w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" />											\n		<p>Kamar mandi yang bersih dan nyaman akan membuat kita lebih betah berlama lama di kamar mandi.</p>		\n										<img width=\"1024\" height=\"684\" src=\"http://localhost/raputrigroup/wp-content/uploads/2020/10/244070510.jpg\" alt=\"Bathroom\" loading=\"lazy\" srcset=\"http://localhost/raputrigroup/wp-content/uploads/2020/10/244070510.jpg 1024w, http://localhost/raputrigroup/wp-content/uploads/2020/10/244070510-300x200.jpg 300w, http://localhost/raputrigroup/wp-content/uploads/2020/10/244070510-768x513.jpg 768w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" />											\n		<p>Setelah bekerja seharian penuh, spa sangat cocok untuk memanjakan anda agar lebih rileks.</p>		\n										<img width=\"1024\" height=\"683\" src=\"http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-andrea-piacquadio-3673941-1024x683.jpg\" alt=\"Spa\" loading=\"lazy\" srcset=\"http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-andrea-piacquadio-3673941-1024x683.jpg 1024w, http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-andrea-piacquadio-3673941-300x200.jpg 300w, http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-andrea-piacquadio-3673941-768x512.jpg 768w, http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-andrea-piacquadio-3673941-1536x1024.jpg 1536w, http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-andrea-piacquadio-3673941-2048x1365.jpg 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" />											\n		<p>Pecinta bunga akan betah berlama lama disini, terdapat taman yang instragameble cocok untuk mengabadikan momen disini.</p>		\n										<img width=\"1024\" height=\"683\" src=\"http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-jill-wellington-413707-1024x683.jpg\" alt=\"Taman\" loading=\"lazy\" srcset=\"http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-jill-wellington-413707-1024x683.jpg 1024w, http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-jill-wellington-413707-300x200.jpg 300w, http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-jill-wellington-413707-768x512.jpg 768w, http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-jill-wellington-413707-1536x1024.jpg 1536w, http://localhost/raputrigroup/wp-content/uploads/2020/10/pexels-jill-wellington-413707-2048x1365.jpg 2048w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" />', 'Layanan', '', 'publish', 'closed', 'closed', '', 'layanan', '', '', '2020-10-17 02:09:56', '2020-10-17 02:09:56', '', 0, 'http://localhost/raputrigroup/?page_id=14', 0, 'page', '', 0),
